const Languages = () => {
  return (
    <section className="languages">
      <h2 className="title-font  pink-text h2-tag">Languages</h2>
      <section>
        <section>
          <h3>English</h3>
          <p>B1 - Intermediate</p>
          <h3>Spanish</h3>
          <p>Native </p>
        </section>
      </section>
    </section>
  );
};

export default Languages;
